const API_URL = "http://localhost:5000/api";

export async function getUsers() {
  try {
    const res = await fetch(`${API_URL}/users`);
    if (!res.ok) throw new Error("Failed to fetch users");
    return await res.json();
  } catch (err) {
    console.error(err);
    return [];
  }
}
